import React from 'react'
import './footer.css'

import {Container,Row,Col,ListGroup,ListGroupItem} from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from "../../assets/images/logo.png";

const quick__links = [
{
  Path: "/home",
  display:"Home",
},
{
  Path: "/about",
  display:"About",
},
{
  Path: "/tours",
  display:"Tours",
}


];

const quick__links2 = [
  {
    Path: "/gallery",
    display:"Gallery",
  },
  {
    Path: "/login",
    display:"Login",
  },
  {
    Path: "/register",
    display:"Register",
  }
  
  
  ];




const Footer = () => {
  return (
    <footer className='footer'>

      <Container>
<Row>
  <Col lg='3'>
  <div className="logo">
    <img src={logo} alt="" />
    <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Fugit eaque consequuntur labore totam unde nostrum, tempore molestias dolorem impedit iusto!</p>
    <div className="social__links d-flex align-items-center gap-4"> 
    <span>
      <Link to='#'><i class="ri-github-fill"></i></Link>
    </span>
    </div>
  </div>
  </Col>
</Row>
      </Container>
    </footer>
  )
}

export default Footer
